import React from 'react';
import { Link } from 'react-router-dom';
import expo from '../data/explores.json';

const Explores = () => {
    const fansNumber = [3, 4, 5]
    return (
        <Link to="#" className=' flex flex-wrap gap-1'>
            {expo.map((kesfet) => (
                <div key={kesfet.id} className='shrink-0'>
                    <img src={kesfet.id.height} alt='' className='w-[315px] h-[315px] object-cover' />
                </div>
            ))}
        </Link>
    );
};

export default Explores;
